import {Dialog,Box} from '@mui/material';


const dialogStyle={

    height:'96%',
    width:'100%',
    maxWidth:'100%',
    maxHeight:'100%',
    boxShadow:'none',
    overflow:'hidden',
    margin:'20px'
}

const ChatDialog = () => {

   return (

    <Dialog
       open={true}
       PaperProps={{sx:dialogStyle}}
       hideBackdrop={true}
    >


    </Dialog>
    
   )
}

export default ChatDialog;
